  return (
    <div>
      <Header title="Hello World" />
      <Header title="Hello World 2" />
      <Header title="Hello World 3" />
      <Header title="Hello World 4" />
      <Header title="Hello World 5" />
      <h1>Conteúdo da aplicação</h1>
    </div>
  );
}

export default App;
